import { Row } from "antd";
import { withTranslation } from "react-i18next";
import LeftContentBlock from "../ContentBlock/LeftContentBlock";
import RightContentBlock from "../ContentBlock/RightContentBlock";

import {
  GenContainer,
  BlockContainer,
  ContentWrapperTitle,
  ContentTitle,
} from "./styles";

const History = () => {

  return (
    <GenContainer>
      <BlockContainer>
          <Row justify="center" align="middle">
            <ContentWrapperTitle>
                <h1>History</h1>
                <ContentTitle>What if we showed our true nature on the web through an Avatar ?</ContentTitle>
            </ContentWrapperTitle>
          </Row>

        <LeftContentBlock 
          title="Light, fast & responsive"
          content="This template is ready to use, so you don't need to change anything at a component level, unless you want to customize the default styling."
          icon="graphs.svg"
          direction="up"
        />

        <RightContentBlock
          title="Light, fast & responsive"
          content="This template is ready to use, so you don't need to change anything at a component level, unless you want to customize the default styling."
          icon="product-launch.svg"
          direction="up"
        />

        <LeftContentBlock
          title="Light, fast & responsive"
          content="This template is ready to use, so you don't need to change anything at a component level, unless you want to customize the default styling."
          icon="waving.svg"
          direction="up"
        />
      </BlockContainer>
    </GenContainer>
  );
};

export default withTranslation()(History);
